"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[22695],{22695:i=>{i.exports=JSON.parse('{"ai21":{"description":"AI21 Labs costruisce modelli di base e sistemi di intelligenza artificiale per le imprese, accelerando l\'adozione dell\'intelligenza artificiale generativa in produzione."},"ai302":{"description":"302.AI \xe8 una piattaforma di applicazioni AI a pagamento on-demand, che offre le API AI e le applicazioni AI online pi\xf9 complete sul mercato"},"ai360":{"description":"360 AI \xe8 una piattaforma di modelli e servizi AI lanciata da 360 Company, che offre vari modelli avanzati di elaborazione del linguaggio naturale, tra cui 360GPT2 Pro, 360GPT Pro, 360GPT Turbo e 360GPT Turbo Responsibility 8K. Questi modelli combinano parametri su larga scala e capacit\xe0 multimodali, trovando ampio utilizzo in generazione di testo, comprensione semantica, sistemi di dialogo e generazione di codice. Con strategie di prezzo flessibili, 360 AI soddisfa le esigenze diversificate degli utenti, supportando l\'integrazione degli sviluppatori e promuovendo l\'innovazione e lo sviluppo delle applicazioni intelligenti."},"aihubmix":{"description":"AiHubMix offre l\'accesso a diversi modelli di intelligenza artificiale tramite un\'interfaccia API unificata."},"akashchat":{"description":"Akash \xe8 un mercato di risorse cloud senza autorizzazioni, con prezzi competitivi rispetto ai fornitori di cloud tradizionali."},"anthropic":{"description":"Anthropic \xe8 un\'azienda focalizzata sulla ricerca e sviluppo dell\'intelligenza artificiale, che offre una serie di modelli linguistici avanzati, come Claude 3.5 Sonnet, Claude 3 Sonnet, Claude 3 Opus e Claude 3 Haiku. Questi modelli raggiungono un equilibrio ideale tra intelligenza, velocit\xe0 e costi, adatti a una variet\xe0 di scenari applicativi, dalle operazioni aziendali a risposte rapide. Claude 3.5 Sonnet, il loro modello pi\xf9 recente, ha mostrato prestazioni eccezionali in diverse valutazioni, mantenendo un alto rapporto qualit\xe0-prezzo."},"azure":{"description":"Azure offre una variet\xe0 di modelli AI avanzati, tra cui GPT-3.5 e l\'ultima serie GPT-4, supportando diversi tipi di dati e compiti complessi, con un impegno per soluzioni AI sicure, affidabili e sostenibili."},"azureai":{"description":"Azure offre una variet\xe0 di modelli AI avanzati, tra cui GPT-3.5 e l\'ultima serie GPT-4, supportando diversi tipi di dati e compiti complessi, impegnandosi per soluzioni AI sicure, affidabili e sostenibili."},"baichuan":{"description":"Baichuan Intelligence \xe8 un\'azienda focalizzata sulla ricerca e sviluppo di modelli di intelligenza artificiale di grandi dimensioni, i cui modelli eccellono in compiti in cinese come enciclopedie di conoscenza, elaborazione di testi lunghi e creazione di contenuti, superando i modelli mainstream esteri. Baichuan Intelligence ha anche capacit\xe0 multimodali leader nel settore, mostrando prestazioni eccezionali in diverse valutazioni autorevoli. I suoi modelli includono Baichuan 4, Baichuan 3 Turbo e Baichuan 3 Turbo 128k, ottimizzati per diversi scenari applicativi, offrendo soluzioni ad alto rapporto qualit\xe0-prezzo."},"bedrock":{"description":"Bedrock \xe8 un servizio offerto da Amazon AWS, focalizzato sulla fornitura di modelli linguistici e visivi AI avanzati per le aziende. La sua famiglia di modelli include la serie Claude di Anthropic, la serie Llama 3.1 di Meta e altro, coprendo una variet\xe0 di opzioni da leggere a ad alte prestazioni, supportando generazione di testo, dialogo, elaborazione di immagini e altro, adatta a diverse applicazioni aziendali di varie dimensioni e necessit\xe0."},"bfl":{"description":"Un laboratorio di ricerca all\'avanguardia nell\'intelligenza artificiale, impegnato nella costruzione dell\'infrastruttura visiva del domani."},"cerebras":{"description":"Cerebras \xe8 una piattaforma di inferenza AI basata sul suo sistema dedicato CS-3, progettata per offrire il servizio LLM pi\xf9 veloce al mondo, con risposta in tempo reale e un\'elevata capacit\xe0 di elaborazione. \xc8 pensata per eliminare la latenza e accelerare i flussi di lavoro AI complessi, come la generazione di codice in tempo reale e le attivit\xe0 degli agenti."},"cloudflare":{"description":"Esegui modelli di machine learning alimentati da GPU serverless sulla rete globale di Cloudflare."},"cohere":{"description":"Cohere ti offre i modelli multilingue pi\xf9 all\'avanguardia, funzionalit\xe0 di ricerca avanzate e uno spazio di lavoro AI su misura per le moderne imprese - il tutto integrato in una piattaforma sicura."},"cometapi":{"description":"CometAPI \xe8 una piattaforma di servizi che offre molteplici interfacce per modelli avanzati, supportando OpenAI, Anthropic, Google e altri ancora, adatta a esigenze di sviluppo e applicazione diversificate. Gli utenti possono scegliere in modo flessibile il modello e il prezzo pi\xf9 adatti alle proprie necessit\xe0, contribuendo a migliorare l\'esperienza AI."},"comfyui":{"description":"Potente motore open source per flussi di lavoro di generazione di immagini, video e audio, compatibile con modelli avanzati come SD, FLUX, Qwen, Hunyuan, WAN, e dotato di funzionalit\xe0 per l\'editing dei flussi tramite nodi e la distribuzione in ambienti privati."},"deepseek":{"description":"DeepSeek \xe8 un\'azienda focalizzata sulla ricerca e applicazione della tecnologia AI, il cui ultimo modello DeepSeek-V2.5 combina capacit\xe0 di dialogo generico e elaborazione del codice, realizzando miglioramenti significativi nell\'allineamento delle preferenze umane, nei compiti di scrittura e nel rispetto delle istruzioni."},"fal":{"description":"Piattaforma di media generativi rivolta agli sviluppatori"},"fireworksai":{"description":"Fireworks AI \xe8 un fornitore leader di servizi di modelli linguistici avanzati, focalizzato su chiamate funzionali e elaborazione multimodale. Il suo ultimo modello Firefunction V2, basato su Llama-3, \xe8 ottimizzato per chiamate di funzione, dialogo e rispetto delle istruzioni. Il modello di linguaggio visivo FireLLaVA-13B supporta input misti di immagini e testo. Altri modelli notevoli includono la serie Llama e la serie Mixtral, offrendo supporto efficiente per il rispetto e la generazione di istruzioni multilingue."},"giteeai":{"description":"L\'API Serverless di Gitee AI fornisce agli sviluppatori di AI un servizio API di inferenza di modelli di grandi dimensioni fuori dagli schemi."},"github":{"description":"Con i modelli di GitHub, gli sviluppatori possono diventare ingegneri AI e costruire con i modelli AI leader del settore."},"google":{"description":"La serie Gemini di Google \xe8 il suo modello AI pi\xf9 avanzato e versatile, sviluppato da Google DeepMind, progettato per il multimodale, supportando la comprensione e l\'elaborazione senza soluzione di continuit\xe0 di testo, codice, immagini, audio e video. Adatto a una variet\xe0 di ambienti, dai data center ai dispositivi mobili, ha notevolmente migliorato l\'efficienza e l\'ampiezza delle applicazioni dei modelli AI."},"groq":{"description":"Il motore di inferenza LPU di Groq ha mostrato prestazioni eccezionali nei recenti benchmark indipendenti sui modelli di linguaggio di grandi dimensioni (LLM), ridefinendo gli standard delle soluzioni AI con la sua incredibile velocit\xe0 ed efficienza. Groq rappresenta una velocit\xe0 di inferenza istantanea, mostrando buone prestazioni nelle implementazioni basate su cloud."},"higress":{"description":"Higress \xe8 un gateway API cloud-native, nato all\'interno di Alibaba per risolvere i problemi causati dal ricaricamento di Tengine sulle connessioni persistenti e per migliorare le capacit\xe0 di bilanciamento del carico di gRPC/Dubbo."},"huggingface":{"description":"L\'API di Inferenza di HuggingFace offre un modo rapido e gratuito per esplorare migliaia di modelli per una variet\xe0 di compiti. Che tu stia prototipando una nuova applicazione o cercando di sperimentare le funzionalit\xe0 del machine learning, questa API ti consente di accedere immediatamente a modelli ad alte prestazioni in diversi ambiti."},"hunyuan":{"description":"Un modello di linguaggio sviluppato da Tencent, dotato di potenti capacit\xe0 di creazione in cinese, abilit\xe0 di ragionamento logico in contesti complessi e capacit\xe0 affidabili di esecuzione dei compiti."},"infiniai":{"description":"Fornisce servizi di modelli di grande dimensione ad alta prestazione, facili da usare e sicuri per gli sviluppatori di applicazioni, coprendo l\'intero processo dalla sviluppo dei modelli alla distribuzione dei servizi."},"internlm":{"description":"Un\'organizzazione open source dedicata alla ricerca e allo sviluppo di strumenti per modelli di grandi dimensioni. Fornisce a tutti gli sviluppatori di AI una piattaforma open source efficiente e facile da usare, rendendo le tecnologie e gli algoritmi all\'avanguardia accessibili a tutti."},"jina":{"description":"Jina AI, fondata nel 2020, \xe8 una delle principali aziende di ricerca AI. La nostra piattaforma di base per la ricerca include modelli vettoriali, riordinatori e piccoli modelli linguistici, per aiutare le aziende a costruire applicazioni di ricerca generativa e multimodale affidabili e di alta qualit\xe0."},"lmstudio":{"description":"LM Studio \xe8 un\'applicazione desktop per sviluppare e sperimentare LLM sul tuo computer."},"minimax":{"description":"MiniMax \xe8 un\'azienda di tecnologia dell\'intelligenza artificiale generale fondata nel 2021, dedicata alla co-creazione di intelligenza con gli utenti. MiniMax ha sviluppato modelli generali di diverse modalit\xe0, tra cui un modello di testo MoE con trilioni di parametri, un modello vocale e un modello visivo. Ha anche lanciato applicazioni come Conch AI."},"mistral":{"description":"Mistral offre modelli avanzati generali, professionali e di ricerca, ampiamente utilizzati in ragionamenti complessi, compiti multilingue, generazione di codice e altro, consentendo agli utenti di integrare funzionalit\xe0 personalizzate tramite interfacce di chiamata funzionale."},"modelscope":{"description":"ModelScope \xe8 una piattaforma di modelli come servizio lanciata da Alibaba Cloud, che offre una ricca gamma di modelli AI e servizi di inferenza."},"moonshot":{"description":"Moonshot \xe8 una piattaforma open source lanciata da Beijing Dark Side Technology Co., Ltd., che offre vari modelli di elaborazione del linguaggio naturale, con ampie applicazioni, inclusi ma non limitati a creazione di contenuti, ricerca accademica, raccomandazioni intelligenti, diagnosi mediche e altro, supportando l\'elaborazione di testi lunghi e compiti di generazione complessi."},"nebius":{"description":"Nebius fornisce infrastrutture ad alte prestazioni agli innovatori dell\'IA di tutto il mondo, costruendo grandi cluster GPU e una piattaforma cloud verticalmente integrata."},"newapi":{"description":"Piattaforma open source per l\'aggregazione e il reindirizzamento unificato di pi\xf9 servizi AI"},"novita":{"description":"Novita AI \xe8 una piattaforma che offre API per vari modelli di linguaggio di grandi dimensioni e generazione di immagini AI, flessibile, affidabile e conveniente. Supporta i pi\xf9 recenti modelli open source come Llama3 e Mistral, fornendo soluzioni API complete, user-friendly e scalabili per lo sviluppo di applicazioni AI, adatte alla rapida crescita delle startup AI."},"nvidia":{"description":"NVIDIA NIM™ fornisce contenitori per l\'inferenza di microservizi accelerati da GPU self-hosted, supportando il deployment di modelli AI pre-addestrati e personalizzati su cloud, data center, PC RTX™ AI e workstation."},"ollama":{"description":"I modelli forniti da Ollama coprono ampiamente aree come generazione di codice, operazioni matematiche, elaborazione multilingue e interazioni conversazionali, supportando esigenze diversificate per implementazioni aziendali e localizzate."},"ollamacloud":{"description":"Ollama Cloud offre un servizio di inferenza ospitato ufficialmente, con accesso immediato alla libreria di modelli Ollama e supporto per interfacce compatibili con OpenAI."},"openai":{"description":"OpenAI \xe8 un\'agenzia di ricerca sull\'intelligenza artificiale leader a livello globale, i cui modelli come la serie GPT hanno spinto in avanti il campo dell\'elaborazione del linguaggio naturale. OpenAI si impegna a trasformare diversi settori attraverso soluzioni AI innovative ed efficienti. I loro prodotti offrono prestazioni e costi notevoli, trovando ampio utilizzo nella ricerca, nel commercio e nelle applicazioni innovative."},"openrouter":{"description":"OpenRouter \xe8 una piattaforma di servizio che offre interfacce per vari modelli di grandi dimensioni all\'avanguardia, supportando OpenAI, Anthropic, LLaMA e altro, adatta a esigenze di sviluppo e applicazione diversificate. Gli utenti possono scegliere in modo flessibile il modello e il prezzo ottimali in base alle proprie necessit\xe0, migliorando l\'esperienza AI."},"perplexity":{"description":"Perplexity \xe8 un fornitore leader di modelli di generazione di dialogo, offrendo vari modelli avanzati Llama 3.1, supportando applicazioni online e offline, particolarmente adatti per compiti complessi di elaborazione del linguaggio naturale."},"ppio":{"description":"PPIO Paeou Cloud offre servizi API per modelli open source stabili e ad alto rapporto qualit\xe0-prezzo, supportando l\'intera gamma di DeepSeek, Llama, Qwen e altri modelli di grandi dimensioni leader del settore."},"qiniu":{"description":"Qiniu \xe8 un fornitore di servizi cloud leader, offrendo API di IA ad alta velocit\xe0 e efficienza, incluso il modello Alibaba, con opzioni flessibili per costruire e applicare applicazioni di IA."},"qwen":{"description":"Qwen \xe8 un modello di linguaggio di grande scala sviluppato autonomamente da Alibaba Cloud, con potenti capacit\xe0 di comprensione e generazione del linguaggio naturale. Pu\xf2 rispondere a varie domande, creare contenuti testuali, esprimere opinioni e scrivere codice, svolgendo un ruolo in vari settori."},"sambanova":{"description":"SambaNova Cloud consente agli sviluppatori di utilizzare facilmente i migliori modelli open source e di godere della velocit\xe0 di inferenza pi\xf9 rapida."},"search1api":{"description":"Search1API fornisce accesso alla serie di modelli DeepSeek che possono connettersi autonomamente, inclusa la versione standard e quella rapida, supportando la scelta di modelli con diverse dimensioni di parametri."},"sensenova":{"description":"SenseTime offre servizi di modelli di grandi dimensioni full-stack, supportati dalla potente infrastruttura di SenseTime."},"siliconcloud":{"description":"SiliconFlow si impegna ad accelerare l\'AGI per il bene dell\'umanit\xe0, migliorando l\'efficienza dell\'AI su larga scala attraverso stack GenAI facili da usare e a basso costo."},"spark":{"description":"Il modello Spark di iFlytek offre potenti capacit\xe0 AI in vari settori e lingue, utilizzando tecnologie avanzate di elaborazione del linguaggio naturale per costruire applicazioni innovative adatte a scenari verticali come hardware intelligente, assistenza sanitaria intelligente e finanza intelligente."},"stepfun":{"description":"Il modello StepFun offre capacit\xe0 multimodali e di ragionamento complesso leader nel settore, supportando la comprensione di testi molto lunghi e potenti funzionalit\xe0 di motore di ricerca autonomo."},"taichu":{"description":"L\'Istituto di Automazione dell\'Accademia Cinese delle Scienze e l\'Istituto di Ricerca sull\'Intelligenza Artificiale di Wuhan hanno lanciato una nuova generazione di modelli di grandi dimensioni multimodali, supportando domande e risposte a pi\xf9 turni, creazione di testi, generazione di immagini, comprensione 3D, analisi dei segnali e altre attivit\xe0 di domanda e risposta complete, con capacit\xe0 cognitive, di comprensione e di creazione pi\xf9 forti, offrendo un\'esperienza interattiva completamente nuova."},"tencentcloud":{"description":"La potenza atomica del motore di conoscenza (LLM Knowledge Engine Atomic Power) \xe8 una capacit\xe0 completa di domande e risposte sviluppata sulla base del motore di conoscenza, rivolta a imprese e sviluppatori, che offre la possibilit\xe0 di costruire e sviluppare applicazioni modello in modo flessibile. Puoi assemblare il tuo servizio modello esclusivo utilizzando diverse capacit\xe0 atomiche, richiamando servizi di analisi documentale, suddivisione, embedding, riscrittura multipla e altro, per personalizzare il tuo business AI esclusivo."},"togetherai":{"description":"Together AI si impegna a raggiungere prestazioni leader attraverso modelli AI innovativi, offrendo ampie capacit\xe0 di personalizzazione, inclusi supporto per scalabilit\xe0 rapida e processi di distribuzione intuitivi, per soddisfare le varie esigenze aziendali."},"upstage":{"description":"Upstage si concentra sullo sviluppo di modelli AI per varie esigenze commerciali, inclusi Solar LLM e document AI, con l\'obiettivo di realizzare un\'intelligenza artificiale generale artificiale (AGI) per il lavoro. Crea semplici agenti di dialogo tramite Chat API e supporta chiamate funzionali, traduzioni, embedding e applicazioni specifiche del settore."},"v0":{"description":"v0 \xe8 un assistente di programmazione in coppia: basta descrivere le tue idee in linguaggio naturale e lui generer\xe0 codice e interfacce utente (UI) per il tuo progetto"},"vercelaigateway":{"description":"Vercel AI Gateway offre un\'API unificata per accedere a oltre 100 modelli, consentendo l\'utilizzo di modelli di diversi fornitori come OpenAI, Anthropic, Google tramite un unico endpoint. Supporta impostazioni di budget, monitoraggio dell\'utilizzo, bilanciamento del carico delle richieste e failover."},"vertexai":{"description":"La serie Gemini di Google \xe8 il suo modello AI pi\xf9 avanzato e versatile, sviluppato da Google DeepMind, progettato per essere multimodale e supportare la comprensione e l\'elaborazione senza soluzione di continuit\xe0 di testo, codice, immagini, audio e video. Adatta a una variet\xe0 di ambienti, dai data center ai dispositivi mobili, migliora notevolmente l\'efficienza e l\'ampia applicabilit\xe0 dei modelli AI."},"vllm":{"description":"vLLM \xe8 una libreria veloce e facile da usare per l\'inferenza e i servizi LLM."},"volcengine":{"description":"La piattaforma di sviluppo dei servizi di modelli di grandi dimensioni lanciata da ByteDance, offre servizi di invocazione di modelli ricchi di funzionalit\xe0, sicuri e competitivi in termini di prezzo, fornendo anche dati sui modelli, messa a punto, inferenza, valutazione e altre funzionalit\xe0 end-to-end, garantendo in modo completo lo sviluppo e l\'implementazione delle vostre applicazioni AI."},"wenxin":{"description":"Piattaforma di sviluppo e servizi per modelli di grandi dimensioni e applicazioni AI native, a livello aziendale, che offre la catena di strumenti completa e facile da usare per lo sviluppo di modelli di intelligenza artificiale generativa e per l\'intero processo di sviluppo delle applicazioni."},"xai":{"description":"xAI \xe8 un\'azienda dedicata alla costruzione di intelligenza artificiale per accelerare le scoperte scientifiche umane. La nostra missione \xe8 promuovere la nostra comprensione collettiva dell\'universo."},"xinference":{"description":"Xorbits Inference (Xinference) \xe8 una piattaforma open source progettata per semplificare l\'esecuzione e l\'integrazione di vari modelli AI. Con Xinference, \xe8 possibile eseguire inferenze utilizzando qualsiasi modello LLM open source, modelli di embedding e modelli multimodali, sia in un ambiente cloud che locale, creando potenti applicazioni AI."},"zeroone":{"description":"01.AI si concentra sulla tecnologia AI dell\'era 2.0, promuovendo attivamente l\'innovazione e l\'applicazione di \\"uomo + intelligenza artificiale\\", utilizzando modelli potenti e tecnologie AI avanzate per migliorare la produttivit\xe0 umana e realizzare l\'abilitazione tecnologica."},"zhipu":{"description":"Zhipu AI offre una piattaforma aperta per modelli multimodali e linguistici, supportando una vasta gamma di scenari applicativi AI, inclusi elaborazione del testo, comprensione delle immagini e assistenza alla programmazione."}}')}}]);